import React, { useState } from 'react';
import './App.css';

function App() {

  const[people, setPeople] = useState([
    {
      name: "Mariana",
      url: "",
      age: 30,
      note: "Is always in the jungle"
    }
  ])

  return (
    <div className="App">
      <h1>People Invited to my Party</h1>
      <ul>
       {people.map(person => <li>{person.name}</li>)}
      </ul>
    </div>
  );
}

export default App;
